import React from 'react'
import Text from '../data/home.json';

const Button = () => {
    return (
        <div className='bg-black text-white font-medium text-lg mb-4 p-2 rounded'>Join the group chat</div>
    )
}

const Render = () => {
    return (
        <>
            <div class='flex flex-col p-8'>
            <div className='mb-4 text-4xl'>&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;</div>
                <div className='mb-4 font-bold text-4xl'>{Text.Title}</div>
                <div className='text-lg mb-4'>{Text.Para}</div>
                <Button />
                </div>
        </>
    )
}

export default Render
